import React, { PureComponent } from 'react'

export class Home extends PureComponent {
  render() {
    return (
      <div>
        <h1>
            This is Home Page.
        </h1>
        <button onClick={()=> navigate('/')}>Redirect</button>
      </div>
    )
  }
}

export default Home
